const allGallery = document.querySelectorAll('.gallery');
const modalContainerImage = document.querySelector('.modal-image-container');
const closeModal = document.querySelector('.close-image');
const prevImage = document.querySelector('.previous-image');
const nextImage = document.querySelector('.next-image');
const modalImage = document.querySelector('.modalImage');
const gallerySection = document.querySelector('.gallery-section');
const footerElement = document.querySelector('footer');
const header = document.querySelector('header');
const nav = document.querySelector('nav');
const sectionTitle = document.querySelector('.section-title');
let currentImageIndex = 0;
const images = [];
allGallery.forEach(gallery => {
    const image = gallery.querySelector('img');
    images.push(image.src);
    gallery.addEventListener('click', () => {
        currentImageIndex = images.indexOf(image.src);
        modalContainerImage.classList.add('active-modal');
        const modalImage = modalContainerImage.querySelector('img');
        modalImage.src = image.src;
        gallerySection.classList.add('blur-body');
        footerElement.classList.add('blur-body');
        sectionTitle.classList.add('blur-body');
        header.classList.add('blur-body');
        nav.classList.add('blur-body');
    });
});
prevImage.addEventListener('click', () => {
    currentImageIndex--;
    if (currentImageIndex < 0) {
        currentImageIndex = images.length - 1;
    }
    const modalImage = modalContainerImage.querySelector('img');
    modalImage.src = images[currentImageIndex];
});
nextImage.addEventListener('click', () => {
    currentImageIndex++;
    if (currentImageIndex >= images.length) {
        currentImageIndex = 0;
    }
    const modalImage = modalContainerImage.querySelector('img');
    modalImage.src = images[currentImageIndex];
});
closeModal.addEventListener('click', () => {
    modalContainerImage.classList.remove('active-modal');
    gallerySection.classList.remove('blur-body');
    footerElement.classList.remove('blur-body');
    sectionTitle.classList.remove('blur-body');
    header.classList.remove('blur-body');
    nav.classList.remove('blur-body');
});
modalContainerImage.addEventListener('click', (event) => {
    if (event.target === modalContainerImage) {
        modalContainerImage.classList.remove('active-modal');
        gallerySection.classList.remove('blur-body');
        footerElement.classList.remove('blur-body');
        sectionTitle.classList.remove('blur-body');
        header.classList.remove('blur-body');
        nav.classList.remove('blur-body');
    }
});;